  pageContainer: {
    width: "100vw",
    height: "100vh",
    backgroundColor: "#022671",
    overflowX: "hidden",
  },
});

const Posts = ({ posts }) => {
  const classes = useStyles();

  return (
    <div className={classes.pageContainer}>
      <Topbar />
      <Intro />
    </div>
  );
};

export default Posts;
